<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link href="https://fonts.googleapis.com/css2?family=Baloo+Paaji+2:wght@400;500;600;700;800&family=Roboto&display=swap" rel="stylesheet">
    <link rel="stylesheet" href="./css/main.css">
    <link rel="manifest" href="/manifest.json">
    <link rel="apple-touch-icon" type="image/svg" sizes="128x128" href="./images/monster8.svg">
    <link rel="icon" type="image/svg" sizes="192x192" href="./images/monster8.svg">
    <link rel="shortcut icon" type="image/svg" href="./images/monster8.svg">
    <title>MonsterJS - Master JavaScript while playing</title>
</head>
<body>
    
    <div id="app"></div>

    <script src="./js/out.js"></script>
    <script>
        if ('serviceWorker' in navigator) {
          window.addEventListener('load', function() {
            navigator.serviceWorker.register('worker.js').then(function(registration) {
              console.log('Worker registration successful', registration.scope);
            }, function(err) {
              console.log('Worker registration failed', err);
            }).catch(function(err) {
              console.log(err);
            });
          });
        } else {
          console.log('Service Worker is not supported by browser.');
        }
      </script>
<script type="text/javascript" src="main.bundle.js?f474ad2914457fac3e79"></script></body>
</html>
